import React from "react";

const Services = () => {
  return (
    <div>
      {/* Top Banner Section */}
      <section
        className="relative w-full min-h-[600px] flex items-center justify-center text-white"
        style={{
          backgroundImage: `url('https://images.unsplash.com/photo-1581091226825-a6a2a5aee158?ixlib=rb-4.0.3&auto=format&fit=crop&w=1470&q=80')`,
          backgroundSize: "cover",
          backgroundPosition: "center",
          backgroundRepeat: "no-repeat",
        }}
      >
        {/* Overlay for readability */}
        <div className="absolute inset-0 bg-black bg-opacity-60"></div>

        {/* Text Content */}
        <div className="relative z-10 text-center">
          <h1 className="text-5xl font-bold">Our Services</h1>
        </div>
      </section>

      {/* Page Content */}
      <div className="p-8 text-center">
        <h2 className="text-2xl font-semibold">Services Page</h2>
        <p className="mt-4 text-gray-600">
          This section can include descriptions or service offerings.
        </p>
      </div>
    </div>
  );
};

export default Services;
